import S from "./styled";
import { useNavigate } from "react-router-dom";
import { useDispatch } from "react-redux";

function History() {
  const navigate = useNavigate();

  const HistoryView = (
    <S.Container>
      <S.Info>
        <S.ReButton>마이페이지로 가기</S.ReButton>
      </S.Info>
      <S.Wrapper></S.Wrapper>
    </S.Container>
  );

  return HistoryView;
}

export default History;
